const name = "Brian Bawuah";

const arrFromName = name.split(" ");


export default function Logo() {

  return (
    <Link href="/">
      <a className="logo">
        {trailAnimation(arrFromName, span)}
        <style jsx>{`
          .logo {
            text-decoration: none;
            color: #4a5568;
            font-weight: bolder;
            font-size: 1.5em;
          }
        `}</style>
      </a>
    </Link>
  );
}
